import logo from './logo.svg';
import './App.css';
import { Container, FormControl, FormLabel, Input } from '@chakra-ui/react';

function App() {
  return (
    <div className="App">
      <Container>
        <FormControl id="current-gpa">
          <FormLabel>GPA actuel</FormLabel>
          <Input type="text" id="current-gpa" />
        </FormControl>
      </Container>
    </div>
  );
}

export default App;
